function showTooltip(dataIndex) {
  echartsInstance.dispatchAction({
    type: 'showTip',
    seriesIndex: 0,
    dataIndex: dataIndex
  });
}
function hideTooltip(dataIndex) {
  echartsInstance.dispatchAction({
    type: 'hideTip'
  });
}
function onPointDragging(dataIndex, pos) {
  values[dataIndex] = echartsInstance.convertFromPixel('grid', pos);
